import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import SignIn from './Components/SignIn';
import SignUp from './Components/SignUp';
import Calendar from './Components/Calendar';
import EventForm from './Components/EventForm';
import GuestList from './Components/GuestList';
import EventList from './Components/EventList';
import NavBar from './Components/NavBar';
import Footer from './Components/Footer';

function App() {
  return (
    <div className="App">
      <Router>
        <NavBar />
        <Routes>
          <Route path="/" element={<div className="user-registration">
              <h2>User Registration/Sign In</h2>
              <SignIn />
              <SignUp />
            </div>} />
          <Route path="/events" element={<div className="events">
              <h2>Events</h2>
              <EventList />
            </div>} />
          <Route path="/guests" element={<div className="guests">
              <h2>Guests</h2>
              <GuestList />
            </div>} />
          <Route path="/add-event" element={<div className="add-event">
              <h2>Add Event</h2>
              <EventForm />
            </div>} />
          <Route path="/calendar" element={<div className="calendar">
              <h2>Calendar</h2>
              <Calendar />
            </div>} />
        </Routes>
        <Footer />
      </Router>
    </div>
  );
}

export default App;
